import React, { useState, useEffect } from 'react';
import { supabase } from './supabaseClient';
import {
  Chart,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns';

// Make sure Chart.js is properly registered before any rendering
Chart.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

const Dashboard = ({ user }) => {
  const [airQualityData, setAirQualityData] = useState([]);
  const [chartData, setChartData] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [hasHVAC, setHasHVAC] = useState(false);
  const [hasEcologica, setHasEcologica] = useState(false);
  const [city, setCity] = useState('Toronto');
  const [firstName, setFirstName] = useState('');

  const chartOptions = {
    responsive: true,
    maintainAspectRatio: false,
    scales: {
      y: {
        beginAtZero: true,
        title: {
          display: true,
          text: 'µg/m³'
        }
      },
      x: {
        type: 'time',
        time: {
          unit: 'day',
          displayFormats: {
            day: 'MMM d, yyyy'
          }
        },
        title: {
          display: true,
          text: 'Date'
        }
      }
    },
    plugins: {
      legend: {
        position: 'top',
      },
      tooltip: {
        callbacks: {
          label: function(context) {
            return `${context.dataset.label}: ${context.parsed.y} µg/m³`;
          }
        }
      }
    }
  };

  useEffect(() => {
    const fetchPreferences = async () => {
      try {
        const { data, error } = await supabase
          .from('user_preferences')
          .select('*')
          .eq('user_id', user.id)
          .single();

        if (error) throw error;

        if (data) {
          setHasHVAC(data.has_HVAC);
          setHasEcologica(data.has_ecologgica);
          setFirstName(data.first_name || '');
          setCity(data.city || 'Toronto');
        }
      } catch (error) {
        console.error('Error fetching preferences:', error);
      }
    };

    const fetchAirQualityData = async () => {
      try {
        const response = await fetch('/api/airquality');
        if (!response.ok) throw new Error('Failed to fetch air quality data');
        const data = await response.json();
        console.log('Air quality data:', data);
        setAirQualityData(data);
      } catch (error) {
        console.error('Error fetching air quality:', error);
      } finally {
        setIsLoading(false);
      }
    };

    if (user) {
      fetchPreferences();
    }
    fetchAirQualityData();
  }, [user]);

  const getChartData = () => {
    const processedData = processAirQualityData(airQualityData, 'pm25');

    const datasets = [
      {
        label: 'Original PM2.5',
        data: processedData.map(d => d.original),
        borderColor: 'rgb(75, 192, 192)',
        tension: 0.1
      }
    ];

    if (hasHVAC) {
      datasets.push({
        label: 'With HVAC (50% reduction)',
        data: processedData.map(d => d.withHVAC),
        borderColor: 'rgb(255, 159, 64)',
        tension: 0.1
      });
    }

    if (hasHVAC && hasEcologica) {
      datasets.push({
        label: 'With HVAC + Ecologica (65% total reduction)',
        data: processedData.map(d => d.withBoth),
        borderColor: 'rgb(54, 162, 235)',
        tension: 0.1
      });
    }

    return {
      labels: processedData.map(d => d.timestamp),
      datasets
    };
  };

  const getChartData10 = () => {
    const processedData = processAirQualityData(airQualityData, 'pm10');

    const datasets = [
      {
        label: 'Original PM10',
        data: processedData.map(d => d.original),
        borderColor: 'rgb(153, 102, 255)',
        tension: 0.1
      }
    ];

    if (hasHVAC) {
      datasets.push({
        label: 'With HVAC (50% reduction)',
        data: processedData.map(d => d.withHVAC),
        borderColor: 'rgb(255, 159, 64)',
        tension: 0.1
      });
    }

    if (hasHVAC && hasEcologica) {
      datasets.push({
        label: 'With HVAC + Ecologica (65% total reduction)',
        data: processedData.map(d => d.withBoth),
        borderColor: 'rgb(54, 162, 235)',
        tension: 0.1
      });
    }

    return {
      labels: processedData.map(d => d.timestamp),
      datasets
    };
  };

  useEffect(() => {
    if (airQualityData.length > 0) {
      console.log('Setting up chart data');
      setChartData({
        pm25: getChartData(),
        pm10: getChartData10()
      });
    }
  }, [airQualityData, hasHVAC, hasEcologica]);

  const processAirQualityData = (data, pollutantType) => {
    return data.map(d => ({
      timestamp: new Date(d.timestamp),
      original: pollutantType === 'pm25' ? d.pm25 : d.pm10,
      withHVAC: hasHVAC ? (pollutantType === 'pm25' ? d.pm25 * 0.5 : d.pm10 * 0.5) : null,
      withBoth: (hasHVAC && hasEcologica) ? 
        (pollutantType === 'pm25' ? d.pm25 * 0.5 * 0.7 : d.pm10 * 0.5 * 0.7) : null
    }));
  };

  return (
    <div className="dashboard">
      <h1>{firstName ? `${firstName}'s ` : ''}{city} Dashboard</h1>

      <div className="chart-container">
        <div className="chart" style={{ height: '400px', width: '100%', position: 'relative' }}>
          <h2>PM2.5 Levels</h2>
          {chartData ? (
            <Line
              data={chartData.pm25}
              options={chartOptions}
              redraw={true}
            />
          ) : (
            <p>Loading data...</p>
          )}
        </div>

        <div className="chart" style={{ height: '400px', width: '100%', position: 'relative' }}>
          <h2>PM10 Levels</h2>
          {chartData ? (
            <Line
              data={chartData.pm10}
              options={chartOptions}
              redraw={true}
            />
          ) : (
            <p>Loading data...</p>
          )}
        </div>
      </div>

      {/* Add a legend explaining the improvements */}
      {(hasHVAC || hasEcologica) && (
        <div className="improvements-legend">
          <h3>Air Quality Improvements:</h3>
          {hasHVAC && <p>• HVAC System: 50% reduction in particulate matter</p>}
          {hasEcologica && <p>• Ecologica System: Additional 30% reduction</p>}
          {hasHVAC && hasEcologica && (
            <p>• Total improvement: 65% reduction in particulate matter</p>
          )}
        </div>
      )}
    </div>
  );
};

export default Dashboard;
